const l=JSON.parse('{"key":"v-2205b418","path":"/Docs/V2/Development/NamingConvention.html","title":"命名规范","lang":"zh-CN","frontmatter":{"lang":"zh-CN","title":"命名规范","description":"在我们的命名规范中，我们规定了类、函数、变量、常量、配置、数据库表和字段的命名约定。类的文件名应使用命名空间定义，并与类库文件的路径一致，文件名采用大驼峰法。方法名采用m+前缀+小驼峰法，属性名采用attr+前缀+大驼峰法。常量以大写字母和下划线命名，配置参数以小写字母和下划线命名。数据库表名和字段名都使用小写字母和下划线连接单词。我们还提供了前缀说明，以便更好地理解命名约定的用途和作用范围。这些规范有助于保持代码的一致性和可读性。"},"headers":[{"level":2,"title":"目录和文件","slug":"目录和文件","link":"#目录和文件","children":[]},{"level":2,"title":"类和接口命名","slug":"类和接口命名","link":"#类和接口命名","children":[]},{"level":2,"title":"变量和函数命名","slug":"变量和函数命名","link":"#变量和函数命名","children":[]},{"level":2,"title":"常量和配置","slug":"常量和配置","link":"#常量和配置","children":[]},{"level":2,"title":"数据库表和字段命名","slug":"数据库表和字段命名","link":"#数据库表和字段命名","children":[]},{"level":2,"title":"前缀说明","slug":"前缀说明","link":"#前缀说明","children":[{"level":3,"title":"1.方法与函数的前缀","slug":"_1-方法与函数的前缀","link":"#_1-方法与函数的前缀","children":[]},{"level":3,"title":"2.存储单位的前缀","slug":"_2-存储单位的前缀","link":"#_2-存储单位的前缀","children":[]},{"level":3,"title":"3.前缀使用注意","slug":"_3-前缀使用注意","link":"#_3-前缀使用注意","children":[]}]}],"git":{"updatedTime":1705147016000,"contributors":[{"name":"zhiguai","email":"2635435377@qq.com","commits":3}]},"filePathRelative":"Docs/V2/Development/NamingConvention.md"}');export{l as data};
